import "./CreateGroup.css";
import { Row, Col, Typography, Divider, Button } from "antd";

function CreateGroup() {
  const { Title } = Typography;
  return (
    <div className="container">
      <Row
        style={{
          marginLeft: "20px",
        }}
      >
        <Col lg={24}>
          <Title level={2}>Create Group</Title>
        </Col>
      </Row>
      <Divider
        style={{
          marginTop: "0",
          borderWidth: 5,
        }}
      />
      <Row>
          <Col></Col>
          <Col></Col>
          <Col></Col>
      </Row>
    </div>
  );
}

export default CreateGroup;
